import React from 'react';

const right = () => {
    if (window.location.pathname === '/ships') {
        return (
            <div className="card-display span-3-of-4">
            ships go here
            </div>
        )

    }
    if (window.location.pathname === '/squadron') {
        return (
            <div className="card-display span-3-of-4">
                squadron goeshere
            </div>
        )
    }
    return (
        <div className="card-display span-3-of-4">
            Nothing selected
        </div>
    )

};

export default right;
